function HeadPage() {

  return (
    <div id='head_content'>
      <section className='banner'>
        <img src={require('../assets/banner01.png').default} alt="" />
      </section>
      <section className='about_us'>
        <div></div>
      </section>
    </div>
  )
}
export default HeadPage;
